import Cards from "./Cards";
import Data from "./Data"


function Element(){
    for(let i=0; i<Data.length-1; i++){
        return (
            <Cards 
                        img = {Data[i].imgsrc}
                        heading = {Data[i].heading}
                        name = {Data[i].name}
                        link = {Data[i].link}
                    />
        )
    }
}

const CardsList = () => {
    return(
        <div className="cards_list">
        <Element />
            
        </div>
    )
}
export default CardsList



